MAX_SUBMITS = 6


def today_solution() -> str:
    days_since_epoch = (datetime.now() - datetime(1970, 1, 1)).days
    return SOLUTION_WORDS[days_since_epoch % len(SOLUTION_WORDS)]


@component
def root() -> Div:
    playing, set_playing = use_state(False)

    def stop_playing() -> None:
        return set_playing(False)

    solution, set_solution = use_state(choice(SOLUTION_WORDS))

    header = Text(content="Wordle", style=text_amber_600 | weight_none)

    if playing:
        return Div(
            style=col | align_children_center,
            children=[
                header,
                play(
                    solution=solution,
                    stop_playing=stop_playing,
                ).with_key(solution),
            ],
        )
    else:

        def play_today() -> None:
            s = today_solution()
            logger.debug("Starting play", solution=s)
            set_solution(s)
            set_playing(True)

        def play_random() -> None:
            s = choice(SOLUTION_WORDS)
            logger.debug("Starting play", solution=s)
            set_solution(s)
            set_playing(True)

        def on_key(event: KeyPressed) -> AnyControl | None:
            match event.key:
                case Key.F1:
                    play_today()
                case Key.F2:
                    play_random()
                case "q":
                    return Quit()

            return None

        # TODO: Having to put weight_none on every text is annoying
        button_style = weight_none | pad_1 | border_mcgugan

        return Div(
            style=col | align_children_center,
            children=[
                header,
                Div(
                    style=col | align_children_center | gap_children_2 | margin_top_4,
                    children=[
                        Text(
                            content=f"[F1] Play Daily ({datetime.today().strftime('%Y-%m-%d')})",
                            style=button_style,
                            on_hover=text_indigo_500 | border_indigo_500,
                            on_mouse_up=lambda e: play_today(),
                        ),
                        Text(
                            content="[F2] Play Random",
                            style=button_style,
                            on_hover=text_emerald_500 | border_emerald_500,
                            on_mouse_up=lambda e: play_random(),
                        ),
                        Text(
                            content="[q] Quit",
                            style=button_style,
                            on_hover=text_red_500 | border_red_500,
                            on_mouse_up=lambda e: Quit(),
                        ),
                    ],
                ),
            ],
            on_key=on_key,
        )


@component
def play(solution: str, stop_playing: Callable[[], None]) -> Div:
    guess, set_guess = use_state("")

    submitted: list[str]
    set_submitted: Setter[list[str]]
    submitted, set_submitted = use_state([])

    state = "win" if submitted and submitted[-1] == solution else "playing" if len(submitted) < MAX_SUBMITS else "loss"

    def on_key(event: KeyPressed) -> AnyControl | None:
        match state, event.key:
            case _, Key.Escape:
                stop_playing()
            case "playing", Key.Backspace:
                if len(guess) > 0:
                    set_guess(guess[:-1])
                else:
                    return Bell()
            case "playing", Key.Enter:
                if guess in GUESSABLE_WORDS:
                    set_guess("")
                    set_submitted(lambda s: [*s, guess])
                else:
                    return Bell()
            case "playing", letter if letter in ascii_letters:
                if len(guess) < 5:
                    set_guess(lambda g: g + letter.upper())
                else:
                    return Bell()
            case "win" | "loss", letter if letter in ascii_letters:
                return Bell()

        return None

    guess_rows = [guess_row(s, solution=solution, type="submitted") for s in submitted]
    if state == "playing":
        guess_rows.append(guess_row(guess, solution=solution, type="current"))
    guess_rows += [guess_row(blank, solution=solution, type="pending")] * (MAX_SUBMITS - len(guess_rows))

    message = ""
    message_style = text_justify_center | pad_y_1 | pad_x_2 | border_light

    if state == "playing":
        if len(guess) == 5 and guess not in GUESSABLE_WORDS:
            message = "Not in word list"
            message_style |= text_red_700
        else:
            message = f"Guess {len(submitted) + 1} of {MAX_SUBMITS}"
    elif state == "win":
        message = f"You won! The word was {solution}"
        message_style |= text_green_600 | border_green_600 | border_double
    elif state == "loss":
        message = f"You lost! The word was {solution}"
        message_style |= text_red_700 | border_red_700 | border_double
    message += "\n[Esc] to return to menu"

    return Div(
        style=col | align_children_stretch,
        children=[
            Div(
                style=col | justify_children_center | align_self_stretch | align_children_center | gap_children_1,
                children=guess_rows,
                on_key=on_key,
            ),
            Div(
                style=row | align_self_center | weight_none | pad_y_1,
                children=[Text(content=message, style=message_style)],
            ),
            keyboard(submitted=submitted, solution=solution, on_key=on_key),
        ],
    )


@component
def guess_row(guess: str, solution: str, type: Literal["submitted", "current", "pending"]) -> Div:
    children = []
    for guess_letter, solution_letter in zip(padded(guess, fillvalue=" ", n=5), solution):
        style = {
            "submitted": border_double,
            "current": border_heavy,
            "pending": border_double,
        }[type]

        if type == "submitted":
            if guess_letter == solution_letter:
                style |= border_green_600
            elif guess_letter in solution:
                style |= border_yellow_300
            else:
                style |= border_red_700
        elif type == "pending":
            style |= border_gray_700
        elif type == "current":
            style |= border_gray_300 if guess_letter != " " else border_gray_500

        children.append(letter_box(letter=guess_letter, style=style))

    return Div(
        style=row | weight_none | align_children_center | gap_children_1,
        children=children,
    )


KEYBOARD = (
    ("Q", "W", "E", "R", "T", "Y", "U", "I", "O", "P"),
    ("A", "S", "D", "F", "G", "H", "J", "K", "L"),
    ("Z", "X", "C", "V", "B", "N", "M"),
)


@component
def keyboard(submitted: list[str], solution: str, on_key: Callable[[KeyPressed], AnyControl | None]) -> Div:
    kb_letter_styles = {letter: border_gray_500 for letter in ascii_uppercase}

    all_submitted_letters = "".join(submitted)
    for letter in all_submitted_letters:
        if letter in solution:
            kb_letter_styles[letter] = border_yellow_300
        else:
            kb_letter_styles[letter] = border_red_700

    for s in submitted:
        for guess_letter, solution_letter in zip(s, solution):
            if guess_letter == solution_letter:
                kb_letter_styles[guess_letter] = border_green_600

    return Div(
        style=col | weight_none | justify_children_center | align_children_center,
        children=[
            Div(
                style=row | weight_none | align_children_center | gap_children_1,
                children=[
                    letter_box(
                        kb_letter,
                        style=kb_letter_styles[kb_letter],
                        on_key=on_key,
                    )
                    for kb_letter in kb_row
                ],
            )
            for kb_row in KEYBOARD
        ],
    )


@component
def letter_box(letter: str, style: Style, on_key: Callable[[KeyPressed], AnyControl | None] | None = None) -> Text:
    return Text(
        content=letter,
        style=style | weight_none | border_heavy | pad_x_1 | pad_y_0,
        on_mouse_up=lambda e: on_key(KeyPressed(key=letter)) if on_key else None,
        on_hover=border_double,
    )


asyncio.run(app(root))
